import react from 'react';
import web from "../src/images/programming-background-collage_23-2149901789.avif"
import { NavLink } from 'react-router-dom';
import common from "./Common";
const Home=()=>{
    return(
        <>
            <common name="Grow your business with"
            imgsrc={web} 
            visit="/service" 
            btname="Get Started"/>
        </>
    )
}
export default Home;
